ora is a nice little village close to Caminha, and it is worth a visit if you are travelling by car. It is on the way to Moledo beach, so you’d better do both on same trip. Nova de Cerveira is a beautiful town, just a few km from Caminha. Here you will find a kind of central square with a beautiful church and some nice houses. ', NULL, 1, 5),
